INSERT INTO `projects` (`id`, `title`, `founder`, `logo`, `short_description`, `description`, `thumbnail`, `image_gallery`, `video_link`, `aditional_information`, `status`) VALUES
(1, 'Ecovia', 'Ecovia', '1645087980-14758982.png', '<p class=\"conpany_text\"><span class=\"company_normal_text\">Ecovia Ltd</span><br /> <span class=\"company_bolded_text\">Bioplastic from cotton fabric scraps</span></p>', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Ecovia is a manufacturer of Bio-Plastic products from cotton fabric scraps. It has been founded in 2020 in Dhaka with the goal to replace plastic usage at a competitive price and to aid the prevention of plastic pollution to ensure an eco-friendly environment for the community. Their biodegradable and bio-compostable biopolymer packaging materials are solutions to soil and water contamination due to spreading of harmful microplastics. This is a green tech initiative which is also sustainable.</span></p>', '1643869017-27258618.png', '1640092375-55070070.jpg', '', NULL, 1),
(2, 'AamarPay', 'AamarPay', '1643096447-63059672.png', '<p class=\"conpany_text\"><span class=\"company_normal_text\">Power Your Business,</span><br /> <span class=\"company_bolded_text\">Accept Payment Smoothly</span></p>', '<p class=\"MsoNormal\" style=\"text-align: justify;\">AamarPay is one of the top leading online payment gateways of Bangladesh. They are committed to provide best payment experience with lowest fee and fast checkout and also accept payments from customers with the easiest integration, quick onboarding, feature filled checkout and best in class performance. Aamarpay offers the most affordable B2B / B2C / C2B online payment experience for businesses.&nbsp;</p>', '1643868953-14277997.png', '1640093492-33095947.jpg', '', NULL, 1),
(9, 'Fashol Dotcom', 'Fashol Dotcom', '1643097199-56738382.png', '<p class=\"conpany_text\"><span class=\"company_normal_text\">Countries Largest Fresh Produce </span><br /> <span class=\"company_bolded_text\">Supply Chain Network</span></p>', '<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Fashol dotcom has revolutionized the food supply chain of Bangladesh in a way that the farmers of Bangladesh can be benefited through fair pricing and at the same time the Retailers dealing with the Perishable food can avail the food supplies at their doorsteps effortlessly at an optimum price. Their unique supply chain has the goal to ensure transparency to the food supply chain and lessen the in between processes for the Retailers. They ensure delivery in doorsteps and have various attractive offers for the retailers.</span></p>', '1643868934-75411198.png', NULL, '', NULL, 1),
(10, 'Markopolo', 'Markopolo', '1643634728-24583909.png', '<p class=\"conpany_text\"><span class=\"company_normal_text\">A Marketing Automation tool that can</span><br /> <span class=\"company_bolded_text\">enhance your marketing team\'s efficiency.</span></p>', '<p class=\"MsoNormal\">Markopolo.ai is an AI-Based cross-channel Digital Marketing Solution that can completely automate online advertising. Markopolo.ai strives to simplify digital marketing with the goal to make online advertising accessible, affordable, and automatic. It provides campaign planning, ad automation, creative generation, smart copywriting, marketing auto pilot and many more services for personal and business use.&nbsp;</p>', '1643868853-26253992.png', NULL, '', NULL, 1),
(11, 'DITECH’s Cyber Security', 'DITECH’s Cyber Security', '1643098139-76936661.png', '<p class=\"conpany_text\"><span class=\"company_normal_text\">Get insights into the </span><br /> <span class=\"company_bolded_text\">mechanism &amp; prospects of cyber security technology</span></p>', '<p class=\"MsoNormal\" style=\"text-align: justify;\">Since DITECH&rsquo;s inception, it has established a strong foothold in the technology industry of the country. DITECH Cyber Security is a 360 degree cyber security services and solutions provider like Network security, cloud security, web app and database security. It also provides technological and IT-related services such as product engineering, warranty management, building cloud, infrastructure, network, etc. It has also partnered up with many of the top Global Cyber Security solution providers.</p>', '1643868839-18309090.png', NULL, '', NULL, 1);

