(27, NULL, 'About Us', 'about-us', '', '<h2 style=\"text-align: center;\">ABOUT VENTURE CAPITAL</h2>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom: 0in; mso-add-space: auto; text-indent: -.25in; line-height: 150%; mso-list: l0 level1 lfo1;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">Dekko ISHO Venture Capital (DIVC) is a sister concern of one of the leading conglomerates, Dekko ISHO Group. This group is the pioneer of garments and textile industry (RMG) in Bangladesh having a state-of-the-art green factory, and also have created its footprint in paints, furniture, apparels, restaurant, technology domain and more. DIVC started its journey in 2022 with the goal to invest in local and foreign start-up companies of various sectors. DIVC is the leading Institutional Investor of Bangladesh that initiated its journey to invest in Start up with great Ideas and also is a startup engagement platform (SEP) that connects investors, partners and clients to the best startups in Bangladesh and beyond through networking, acceleration, investment and engagement.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">While Dekko ISHO group has been primarily concerned with RMG manufacturing since its inception, it also has successfully introduced a range of diverse portfolio businesses in the market (Roxy Paints, ISHO, Klubhaus &amp; Izakaya). At the beginning of 2021, we started our journey in technology domain with Dekko ISHO Technologies Limited (DITECH) focusing on providing Cyber Security Solutions &amp; Services. Our journey of investing in startups began with a desire to participate in the fast-growing technology industry of the country, as well as an effort to diversify our business portfolio and be a part of the modern and soon to be mainstream business ecosystem of the country. At the end of 2021, we have initiated DIVC in order to contribute deeply in the startup ecosystem of Bangladesh. We provide a 360-degree solution to startups which includes investments, strategy formulation and planning, recruitment of resources, fund arrangement, ensuring Product Market Fit, networking, connecting with future Investors and so on. So far, we have already invested in some of the emerging sectors of Bangladesh like, Markopolo.ai (deep tech), Ecovia (sustainable tech), Fashol (Agri-tech) and Aamarpay (Fintech) and some of them are in the pipeline.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">We emphasize on the Startups with sustainable business models and practices, that have the ability transform the way things are ordinarily done, SOLVES A PROBLEM and will actually affect/ change the lives of the people they aim to serve. We have a particular affinity towards startups in the IoT and big data analytics sectors and also highly interested in start-ups with a sustainability &amp; green agenda.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Mission (TBD)</strong></p>\r\n<p>To provide seed investment to startups and strategical aid to the future business tycoons of Bangladesh.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Vision (TBD)</strong></p>\r\n<p>To grow exponentially as the largest seed investor in Bangladesh and across global borders.<br />At the core of the work we do is the guiding belief that entrepreneurs are humanity&rsquo;s greatest catalysts for positive change.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>OUR GOALS</strong></p>\r\n<ul>\r\n<li>Believe &amp; invest in People &amp; Ideas</li>\r\n<li>Empower high potential founders to achieve success.</li>\r\n<li>Make a positive impact on society</li>\r\n<li>Win- win partnerships to Facilitate high performing</li>\r\n<li>Enable access to funding, resources and opportunities</li>\r\n<li>Providing mentorship and strategic support to the Startups</li>\r\n</ul>', 'page', NULL, 'enable', '{\"1\":\"1\",\"2\":\"0\",\"3\":\"0\",\"5\":\"0\"}', '1', 'frontend', '', '', '0', 'page', '', 150, 0, NULL, NULL, '', '2017-11-04 00:27:32', '1970-01-01 00:00:00'),
